 For any other inquiries,  please call us: 647 930 88 99 or visit our website at: www.bathstyle.ca, for more information.

Manufacturer of ComfortSeries™ Accessible & Walk-in Bathtubs. 
Direct-to-Consumer Sales (Canada-wide) with full service supply & installation of ComfortSeries™ Accessible & Walk-in Bathtubs

PRODUCT FEATURES for Safety-Comfort-Convenience :
▪️RevitaJet® Whole Body Hydrotherapy Massage System with 44 Air & Water Jets & Legs-only feature; 
▪️Chromatherapy & Aromatherapy Systems for mental wellness support; 
▪️American Standard premium fast-fill faucet with personal handshower and safety slidebar clip if you want to stand to shower; 
▪️EasyTouch Control Pad for easy operation by all, including those with Arthritis; 
▪️QuickDrain® Fast Water Removal System allowing you to exit quickly in under 2 minutes; 
▪️InLine Heater to keep the water at your desired temperature; 
▪️Ozone Sanitary System for bacteria-free bathing; 
▪️17” ADA contoured seat; 
▪️inward door or accessible outward door with barrier-free seat transfer; 
▪️patented leak-free door;
▪️built-in safety grab bar & wall-mounted safety bar; 
▪️all features/controls within arm's reach to prevent slipping;
▪️angled foot rests with air jets; 
▪️textured floor; 
▪️choice of 4 sizes
▪️installation is included

PRODUCT BENEFITS :
Hydrotherapy therapeutic advancements assist and provide pain & general relief from the following disabilities and impairments:
▪️Immobility & Paraplegia
▪️Stroke & Paralysis
▪️Arthritis and Fibromyalgia
▪️Inflammation and Circulatory Disease
▪️Diabetes
▪️Joint Compression & Pain
▪️Sciatica Pain
▪️Knee & Hip Pain from injury and/or replacement & Back Pain from injury
▪️Joint Stiffness & Muscle Pain
▪️Insomnia, Anxiety & Stress

-includes Safety Bathroom Assessment & Quote
-includes (Product & Installation) Lifetime Warranty, backed by American Standard 
-available in each Canadian province 
-all installations are provided exclusively to and for American Standard Canada by The Walkin Tub Company.
